export const schema = `{
    "type": "object",
    "tablename": "People",

    "properties": {

      "name": {
        "type": "string"
      },

      "birthdate": {
        "type": "string",
        "format": "date"
      },

      "company id": {
        "type": "integer",
        "minimum": 100000,
        "maximum": 999999
      },

      "department": {
        "type": "string",
        "enum": ["R&D", "Sales", "Marketing", "Management"]
      },

      "uses company car": {
        "type": "boolean"
      }

    },

    "required": [
      "name",
      "birthdate",
      "company id",
      "department",
      "uses company car"
    ]
  }`;

export default schema
